function initPagination() {
    $(window).scroll(function() {
        if ($('.load_more-container').length) {
            if (($(window).scrollTop() + $(window).height()) > $('.load_more-container').offset().top) {
                var targetContainer = $('.sm-list'),
                    url = $('.load_more').attr('data-url');

                if (url !== undefined && !$('.load_more').hasClass('loading')) {
                    $('.load_more').addClass('loading');

                    $.ajax({
                        type: 'GET',
                        url: url,
                        dataType: 'html',
                        success: function(data){
                            //    
                            $('.load_more').removeClass('loading');
                            $('.load_more-container').remove();

                            var elements = $(data).find('.sm-item'),  //   
                                pagination = $(data).find('.load_more-container');//   


                            targetContainer.append(elements);   //      
                            $('.nav-load').append(pagination); //    


                            //initCompare();

                            elements.each(function () {
                                initAjaxCatalogForm(this);
                            });

                            var elementsArray = $.map(elements, function(value, index) {
                                return [value];
                            });

                            window.initCalcRent(elementsArray);
                        }
                    });

                }
            }
        }
    });

    var width = newsWidthPagination();
    $('.news-slider__navigation').css({ width: width, 'margin-left' : -(width/2) });

    $(window).resize(function () {
        var width = newsWidthPagination();
        $('.news-slider__navigation').css({ width: width, 'margin-left' : -(width/2) });
    });
}

function newsWidthPagination() {
    var width = 0;
    $('.news-slider__pagination span').each(function () {
        width += $(this).width() + 10;
    });

    return width;
}


