function initContactsMap(res) {
    var th = $('#contacts-map');
    if (th.length) {
        ymaps.ready(initContactsMapContainer);
        var map;
        var zoom = $(window).width() > 540 ? 4 : 3;

        function initContactsMapContainer() {

            map = new ymaps.Map(th[0], {
                center:[55.724414,48.267597],
                zoom: zoom,
                controls: ['zoomControl']
            }, {
                suppressMapOpenBlock: true
            });

            map.behaviors.disable('scrollZoom');

            for (var key in res) {

                    var placemark;
                    var marker = '/local/templates/aurora/img/svg/contact-marker-region.svg';
                    var markerSize = [14,14];
                    var markerOffset = [-7, -7];

                    if (res[key]['PROPERTIES']['BRANCH_NAME']['VALUE'] == ' ') {
                        marker = '/local/templates/aurora/img/svg/contact-marker-main.svg';
                        markerSize = [32,32];
                        markerOffset = [-16, -16];
                    } else if (res[key]['PROPERTIES']['BRANCH_NAME']['VALUE'] == '') {
                        marker = '/local/templates/aurora/img/svg/contact-marker-dealer.svg';
                        markerSize = [14,14];
                        markerOffset = [-7, -7];
                    }

                    placemark = new ymaps.Placemark(
                        res[key]['PROPERTIES']['COORDINATES']['VALUE'].split(','),
                        {},
                        {
                            iconLayout:"default#image",
                            iconImageHref: marker,
                            iconImageSize: markerSize,
                            iconImageOffset: markerOffset
                        }
                    );

                    placemark['contact_id'] = res[key]['FIELDS']['ID'];


                map.geoObjects.add(placemark);

                placemark.events.add('click', function (e) {
                    var object = e.get('target');
                    var card = $('.contact-card[data-id="' + object['contact_id'] + '"]');

                    card.parents('.find-contact__list').find('.find-contact__list-item').removeClass('active');
                    card.parent().addClass('active');

                    card.parents('.find-contact__cards-list').animate({
                        scrollTop: card.position().top
                    }, 300);

                    card.parents('.find-contact__cards-list').animate({
                        right: 0
                    }, 150);

                    map.setCenter(e.get('coords'));


                });

                    map.geoObjects.add(placemark);
            }

            $('.contact-card .contact-card__close-btn').on('click', function () {
                $(this).parents('.contact-card').hide();
            })
        }
    }
}
