function initForms() {
    $('.header-form svg').on('click', function () {
        $(this).parents('form').submit();
    });

    $('.modal').show();
    $('[data-type="ajax"]').submit(function (e) {
        e.preventDefault();

        var form = $(this);

        setTimeout(function () {
            $('.radio-form__field').each(function () {
                if ($(this).find('input:checked').length) {
                    $(this).removeClass('is-invalid').addClass('is-valid');
                } else {
                    $(this).removeClass('is-valid').addClass('is-invalid');
                }
            });

            $('.feedback-form__field--inn').each(function () {
                if ($(this).find('input').val().length < 10) {
                    $(this).removeClass('is-valid').addClass('is-invalid');
                } else {
                    $(this).removeClass('is-invalid').addClass('is-valid');
                }
            });

            if (!form.find('.is-invalid').length) {
                var formElement = form[0];
                var request = new XMLHttpRequest();

                request.open("POST", location.pathname);
                request.send(new FormData(formElement));

                setTimeout(function () {
                    formElement.reset();
                }, 1000);

                $('.form-error').hide();

                form.find('.form-done').fadeIn(200, function () {
                    $(this).delay(5000).fadeOut(200, function () {
                        var modal = form.parents('.modal');
                        if (modal.length) {
                            modal.find('.modal__close-btn').trigger('click');
                        }
                    });
                });

                var popup = form.parent().find('.popup-done, .popup-done__overlay');

                popup
                    .css('visibility', 'visible')
                    .animate({
                        opacity: 1,
                    }, 200);

                form.parent().find('.modal__close-btn, .popup-done__overlay').on('click', function () {
                    popup.animate({
                            opacity: 0,
                        }, 200, function () {
                        popup.css('visibility', 'hidden');
                    });
                });

            } else {

                form.find('.form-error').fadeIn(200, function () {
                    $('body, html').animate({
                        scrollTop: $(form.find('.is-invalid')[0]).offset().top - $('header').height()
                    }, 300);
                });
            }
        }, 10);

        /*request.onreadystatechange = function () {
            if (request.readyState === 4 && request.status === 200) {
                if (request.responseText === 'Y' || request.responseText === 'OK') {

                }
            }
        }*/
    });

    $('[data-open-modal="modal-reserve"]').on('click', function () {

        $('.reserve__price-old').html('').hide();

        $('.modal-reserve [data-field="horizontal_reach"]').html('').parents('.characteristics__item').hide();

        $(this).parents('[data-card="product"]').find('[data-field]').each(function () {
            var field = $(this).attr('data-field');
            var modal = $('[data-modal="modal-reserve"]');


            if (field === 'img') {
                modal.find('[data-field="' + field + '"]').attr('src', $(this).attr('src'));
            } else if (field === 'name') {
                modal.find('[data-field="' + field + '"]').html($(this).html());
                $('.equipment_order').val($(this).text());
            } else if (field === 'price-old') {
                modal.find('[data-field="' + field + '"]').html($(this).html()).show();
            } else if (field === 'horizontal_reach') {
                modal.find('[data-field="' + field + '"]').html($(this).html()).parents('.characteristics__item').show();
            } else {
                modal.find('[data-field="' + field + '"]').html($(this).html());
            }
        });
    });

    var tel = $('[type="tel"]');

    tel.mask('+Z (000) 000-00-00', {
        translation: {
            'Z': {
                pattern: /[78]/, optional: false
            }
        }
    })

    tel.keyup(function () {
        if (tel.val() === '+8') {
            tel.val('+7');
        }
    });

    $('.btn-reservation').on('click', function () {

        if ($(this).attr('data-open-modal') === 'popup-catalog-sale') {
            renderPopup(this);
        } else if ($(this).parent().find('.btn-order').attr('data-open-modal') === 'popup-catalog-rent') {
            /*if ($(this).hasClass('btn-reservation--active')) {
                $(this).parent().find('[data-open-modal]')[0].click();
                renderPopup(this);
            }*/

            var orderBtn = $(this).parent().find('.btn-order');
            var th = this;

            orderBtn
                .fadeIn()
                .on('click', function () {
                    renderPopup(th);

                    orderBtn.fadeOut();
                    $(th).removeClass('btn-reservation--active');
                });
        }

        function renderPopup(th) {
            var modal = $('[data-modal="popup-catalog-rent"], [data-modal="popup-catalog-sale"]');
            var card = $(th).parents('.catalog-card, .product-card');
            var formula = card.find('.formula');

            modal.find('.popup-card__image img').attr('src', card.find('.catalog-card__image img, .product-slider__main-item img').attr('src'));
            modal.find('.popup-card__title').text(card.find('.catalog-card__title, .main-header__title').text());
            modal.find('.popup-card__specs').html(card.find('.catalog-card__specs, .product-specs').html());

            if (formula.length) {
                var days = +card.find('[name="request"]').val();
                var titleDays = card.find('.request-block__wrapper label[for="zoomlion-1"]').text();
                var price = 0;
                var addPrice = false;
                var sum = 0;

                card.find('.explanation__item').each(function () {
                    if (this.dataset.max) {
                        if (days >= +this.dataset.min && days <= +this.dataset.max) {
                            price = this.dataset.price;
                            addPrice = true;
                        }
                    } else if (!addPrice) {
                        price = this.dataset.price;
                    }

                });

                sum += +(price.replace(' ', '')) * days;

                modal.find('.popup__sale--price .popup__sale--value').text(price + ' .');
                modal.find('.popup__sale--days .popup__sale--title').text(titleDays);
                modal.find('.popup__sale--days .popup__sale--value').text(days);
                modal.find('.popup__sale--sum .popup__sale--value').text(sum.toDivide() + ' .');

                var cardTitle = card.find('.catalog-card__title').text() ? card.find('.catalog-card__title').text() : $('.main-header__title').text();

                modal.find('.product_name').val(cardTitle);
                modal.find('.input_price').val(price + ' .');
                modal.find('.input_days').val(days);
                modal.find('.input_sum').val(sum.toDivide() + ' .');
            } else {
                modal.find('.popup__sale--price .popup__sale--value').text(card.find('.card-price__sale, .product-price__new').text());

                var cardTitle = card.find('.catalog-card__title').text() ? card.find('.catalog-card__title').text() : $('.main-header__title').text();
                var cardPrice = card.find('.card-price__sale').text() ? card.find('.card-price__sale').text() : $('.product-price__new').text();

                modal.find('.product_name').val(cardTitle);
                modal.find('.input_price').val(cardPrice);
            }
        }
    });
}

function initAjaxCatalogForm(card) {
    $(card).find('.btn-reservation').on('click', function () {
        if ($(this).attr('data-open-modal') === 'popup-catalog-sale') {
            renderPopup(this);
        } else if ($(this).parent().find('.btn-order').attr('data-open-modal') === 'popup-catalog-rent') {
            /*if ($(this).hasClass('btn-reservation--active')) {
                $(this).parent().find('[data-open-modal]')[0].click();

            }*/

            var orderBtn = $(this).parent().find('.btn-order');
            var th = this;

            orderBtn
                .fadeIn()
                .on('click', function () {
                    renderPopup(th);

                    orderBtn.fadeOut();
                    $(th).removeClass('btn-reservation--active');
                });
        }

        function renderPopup(th) {
            var modal = $('[data-modal="popup-catalog-rent"], [data-modal="popup-catalog-sale"]');
            var card = $(th).parents('.catalog-card, .product-card');
            var formula = card.find('.formula');

            modal.find('.popup-card__image img').attr('src', card.find('.catalog-card__image img, .product-slider__main-item img').attr('src'));
            modal.find('.popup-card__title').text(card.find('.catalog-card__title, .main-header__title').text());
            modal.find('.popup-card__specs').html(card.find('.catalog-card__specs, .product-specs').html());

            if (formula.length) {
                var days = +card.find('[name="request"]').val();
                var price = 0;
                var addPrice = false;
                var sum = 0;


                card.find('.explanation__item').each(function () {
                    if (this.dataset.max) {
                        if (days >= +this.dataset.min && days <= +this.dataset.max) {
                            price = this.dataset.price;
                            addPrice = true;
                        }
                    } else if (!addPrice) {
                        price = this.dataset.price;
                    }
                });

                sum += +price.replace(' ', '') * days;

                modal.find('.popup__sale--price .popup__sale--value').text(price + ' .');
                modal.find('.popup__sale--days .popup__sale--value').text(days);
                modal.find('.popup__sale--sum .popup__sale--value').text(sum.toDivide() + ' .');

                modal.find('.product_name').val(card.find('.catalog-card__title').text());
                modal.find('.input_price').val(price + ' .');
                modal.find('.input_days').val(days);
                modal.find('.input_sum').val(sum.toDivide() + ' .');
            } else {
                modal.find('.popup__sale--price .popup__sale--value').text(card.find('.card-price__sale').text());

                modal.find('.product_name').val(card.find('.catalog-card__title').text());
                modal.find('.input_price').val(card.find('.card-price__sale').text());
            }
        }
    });
}

function initPopups() {
    $('.popup-image').magnificPopup({
        type:'image'
    });
}

function setNameService(name) {
    $('.feedback-form__field--name_office input[type=text]').val(name);
}

function initSliders() {
    initSlider(document.querySelectorAll('.career-slider'), [2,2,2,1]);
}

function initSlider(gallerySliders, slidesPerView) {

    if (!gallerySliders) {
        return;
    }

    gallerySliders.forEach(function (slider) {
        var swiperNode = slider.querySelector('.swiper');
        var btnPrev = slider.querySelector('.swiper-button-prev');
        var btnNext = slider.querySelector('.swiper-button-next'); // eslint-disable-next-line no-undef

        var swiper = new Swiper(swiperNode, {
            loop: true,
            slidesPerView: slidesPerView[0],
            spaceBetween: 30,
            navigation: {
                nextEl: btnNext,
                prevEl: btnPrev
            },
            breakpoints: {
                0: {
                    slidesPerView: slidesPerView[3]
                },
                540: {
                    slidesPerView: slidesPerView[2]
                },
                1023: {
                    slidesPerView: slidesPerView[1]
                },
                1279: {
                    slidesPerView: slidesPerView[0]
                }
            }
        });
        gallerySwipers.push(swiper);
    });
}

Number.prototype.toDivide = function() {
    var int = String(Math.trunc(this));
    if(int.length <= 3) return int;
    var space = 0;
    var number = '';

    for(var i = int.length - 1; i >= 0; i--) {
        if(space == 3) {
            number = ' ' + number;
            space = 0;
        }
        number = int.charAt(i) + number;
        space++;
    }

    return number;
}

